class ExperienceRepositoryImpl(private val service: ExperienceService): ExperienceRepository {
    override fun getExperience(id: String): Flow<Resource<Experience>> = flow {

        try {
            emit(Resource.Loading<Experience>())

            service.getExperience(id).let{ response ->
                if (response.isSuccessful && response.body() != null){
                    emit(Resource.Success(response.body()!!))
                }
                else{
                    emit(Resource.Error<Experience>("An unexpected error occurred"))
                }
            }

        } catch(e: HttpException) {
            emit(Resource.Error<Experience>(e.localizedMessage ?: "An error occurred"))
        }
        catch(e: IOException) {
            emit(Resource.Error<Experience>("Couldn't reach server. Check your internet connection and try again"))
        }
    }

    override fun getExperienceStream(id: String): Flow<Resource<ExperienceStream>> = flow {

